import 'dart:convert';

import 'package:file/file.dart';
import 'package:file/memory.dart';
import 'package:flutter/services.dart';
import 'package:flutter_cache_manager/flutter_cache_manager.dart';
import 'package:mocktail/mocktail.dart';

class MockAppImageCacheManager extends Mock implements BaseCacheManager {
  final _fs = MemoryFileSystem();

  MockAppImageCacheManager();

  @override
  Stream<FileResponse> getFileStream(
    String url, {
    String? key,
    Map<String, String>? headers,
    bool? withProgress,
  }) async* {
    final file = await getCustomFile();

    if (withProgress ?? false) {
      yield DownloadProgress(url, 100, 100);
    }

    yield FileInfo(
      file,
      FileSource.Cache,
      DateTime.now().add(const Duration(days: 1)),
      url,
    );
  }

  @override
  Stream<FileInfo> getFile(
    String url, {
    String? key,
    Map<String, String>? headers,
  }) async* {
    final file = await getCustomFile();

    // Set the validity date to 30 days from now
    final validTill = DateTime.now().add(const Duration(days: 30));

    // Returning a FileInfo object with the file path,
    // source as FileSource.online, and validity
    yield FileInfo(file, FileSource.Online, validTill, '');
  }

  @override
  Future<File> putFile(
    String url,
    Uint8List fileBytes, {
    String? key,
    String? eTag,
    Duration maxAge = const Duration(days: 30),
    String fileExtension = 'file',
  }) async {
    return await getCustomFile();
  }

  @override
  Future<FileInfo> downloadFile(
    String url, {
    String? key,
    Map<String, String>? authHeaders,
    bool force = false,
  }) async {
    // Create a temporary file path
    final file = await getCustomFile();

    // Set the validity date to 30 days from now
    final validTill = DateTime.now().add(const Duration(days: 30));

    // Returning a FileInfo object with the file path,
    // source as FileSource.online, and validity
    return FileInfo(file, FileSource.Online, validTill, url);
  }

  @override
  Future<FileInfo?> getFileFromCache(
    String key, {
    bool ignoreMemCache = false,
  }) async {
    final file = await getCustomFile();

    // Set the validity date to 30 days from now
    final validTill = DateTime.now().add(const Duration(days: 30));

    // Returning a FileInfo object with the file path,
    // source as FileSource.online, and validity
    return FileInfo(file, FileSource.Online, validTill, '');
  }

  @override
  Future<FileInfo?> getFileFromMemory(String key) async {
    final file = await getCustomFile();

    // Set the validity date to 30 days from now
    final validTill = DateTime.now().add(const Duration(days: 30));

    // Returning a FileInfo object with the file path,
    // source as FileSource.online, and validity
    return FileInfo(file, FileSource.Online, validTill, '');
  }

  @override
  Future<File> getSingleFile(
    String url, {
    String? key,
    Map<String, String>? headers,
  }) async {
    final file = await getCustomFile();

    return file;
  }

  Future<File> getCustomFile() async {
    final file = _fs.systemTempDirectory.childFile('test_image.png');

    if (!file.existsSync()) {
      await file.create(recursive: true);

      const String base64Image =
          '';

      await file.writeAsBytes(base64Decode(base64Image));
    }
    return file;
  }
}
